import React, { useState } from 'react';
import { ShoppingCartOutlined, MenuOutlined } from '@ant-design/icons';
import '../../index.css';

const MyNavbar = () => {
    return (
        <Navbar>
            <NavItem href="/" title="Home" />
            <NavItem href="/" title="Products" />
            <NavItem href="/" title="About" />
            <NavItem href="/" title={<ShoppingCartOutlined className="shopping-cart"/>} />
        </Navbar>
            // {mobileMenu}
            // <a href="/"><ShoppingCartOutlined className="shopping-cart-mobile"/></a>
            // 
    );
}

const Navbar = (props) => {
    
    const [openMenu, setOpenMenu] = useState(false);
    
    return(
        <div className="navbar">
            <div className="nav-logo">
                <a href="/">Bio Market</a>
            </div>
            <ul className="nav-links">{ props.children }</ul>
            <a href="#"><MenuOutlined className="mobile-navbar" /></a>
        </div>
    )
}

const NavItem = (props) => {
    return(
        <li>
            <a href={props.href}>
                {props.title}
            </a>
        </li>
    )
}

export default MyNavbar;
